import { useEffect, useState } from "react"
import axios from "axios"
function Cardata(){
    const [cars, setcars] = useState('')
   useEffect(() => {
    axios.get('http://localhost:9292/cars')
    .then(res =>{
      console.log(res)
      setcars(res.data)
    }

    )},[],)
    return (
      [cars,setcars]
    )
}

export default Cardata
